  return (
    <div>
      <div className='prod-container'>
        {
          ProductData.map((curElm)=>{
            return(
              <>
              <div className='prod-box'>
                
              </div>
              </>
            )
          })
        }
      </div>

    </div>
  )
}

export default Product
